// import db from './db.json';

function InfoPlate(db) {
  console.log(db.results);

  return (
    <ul>
      {' '}
      {db.results.map((item) => (
        <li className="item">
          {item.id}
          {item.title}
        </li>
      ))}
    </ul>
  );
}

export default InfoPlate;
